int n =  sizeof(A)/sizeof(int);
int h =n-1;
void merge(int l ,int m ,int h){
    int n1 = m-l +1;
    int n2 = h-m;
    
    int B[n1];
    int C[n2];
    for(int i=0;i<n1;i++){
        B[i] =A[l+i];
       // i++;
    }
    for(int j= 0;j<n2;j++){
        C[j]=A[m+1+j];
    }
    
    int i=0 ,j=0 ,k=l;
    
    while(i<n1 && j<n2){
        if(B[i]<=C[j]){
            A[k]=B[i];
            k++ ,i++;
        }
        else{
            A[k]=C[j];
            k++;
            j++;
        }
    }
    
    for(;i<n1;){
        A[k++] = B[i++];
        }

    for(;j<n2;){
        A[k++] = C[j++];
    }
}

void mergeSort(int l ,int h){
    if(l<h){
        int m = (l+h)/2;
        mergeSort(l,m);
        mergeSort(m+1,h);
        merge(l,m,h);
    }
}
